    <div>
      <h1>Dale like si te gusta lo que ves</h1>
      <button onClick={setContador1(contador1++)}> {contador1} Contar like</button>
    </div>
  )
}
const rootElement = document.getElementById("root");
ReactDOM.render(<Likes/>, rootElement);
